function App() {
  return (
    <div style={{ textAlign: 'center', marginTop: '50px', fontFamily: 'Arial' }}>
      <h1>Welcome to ZeroBite Bhimavaram</h1>
      <p style={{ color: 'green', fontSize: '24px', fontWeight: 'bold' }}>
        If you can see this message, React is working!
      </p>
    </div>
  );
}

export default App;
